import React from "react";
import RowCell from "./RowCell";

const TableRow = (props) => {
   const rowCells = props.data.map((data) => {
      return <RowCell key={data.id} value={data.value} />;
   });
   const sumRow = props.data.reduce((sum, data) => sum + data.value);
   console.log(sumRow)
   return (
      <tr>
         {rowCells}
         <td>{sumRow}</td>
      </tr>
   );
};

export default TableRow;
